import React from "react";

function Food({ name, picture }){
  return <div>
    <h2>i like {name}</h2>
    <img src={picture}/>
  </div>
}

const FoodILike = [
  {
    name:"kimchi",
    image: "data:image/jpeg;base64,"
  },
  {
    name:"bibimpop",
    image: "data:image/jpeg;base64,"

  },
  {
    name:"pizza",
    image: "data:image/jpeg;base64,"
  }
];

function App() {
  return (
    <div> 
      {FoodILike.map(dish =>
        <Food name={dish.name} picture={dish.image} />)}
    </div>
  );
}

export default App;
 